        #region " - - - - - - ParseHtmlSearchEngineResults Tests - - - - - - "

        [Fact]
        public void ParseHtmlSearchEngineResults_NoMatches_ReturnEmptyCollection()
        {
            // Arrange
            var _GoogleResultsPageParser = new GoogleResultsPageParser();
            var _HtmlContent = "<HTML></HTML>";

            // Act
            var _SearchEngineResults = _GoogleResultsPageParser.ParseHtmlSearchEngineResults(_HtmlContent);

            // Assert
            Assert.Empty(_SearchEngineResults);
        } //ParseHtmlSearchEngineResults_NoMatches_ReturnEmptyCollection

        [Fact]
        public void ParseHtmlSearchEngineResults_MatchPresent_CorrectStringCaptured()
        {
            // Arrange
            var _GoogleResultsPageParser = new GoogleResultsPageParser();
            const string EXPECTED_CAPTURED_LINK = "https://www.infotrack.com.au/products/property-searches/title-search/";
            var _HtmlContent = "<a href=\"/url?q=https://www.infotrack.com.au/products/property-searches/title-search/\"><div class=\"BNeawe vvjwJb AP7Wnd\">Title Search | InfoTrack</div><div class=\"BNeawe UPmit AP7Wnd\">https://www.infotrack.com.au &#8250; products &#8250; property-searches &#8250; title-search</div></a></div><div class=\"NJM3tb\"></div><div class=\"jfp3ef\"><div><div class=\"BNeawe s3v9rd AP7Wnd\"><div><div>";

            // Act
            var _SearchEngineResults = _GoogleResultsPageParser.ParseHtmlSearchEngineResults(_HtmlContent);

            // Assert
            Assert.Collection(_SearchEngineResults, r => Assert.Equal(EXPECTED_CAPTURED_LINK, r.ResultLink));
        } //ParseHtmlSearchEngineResults_MatchPresent_CorrectStringCaptured

        [Fact]
        public void ParseHtmlSearchEngineResults_MultipleMatches_PositionsAndCapturesPreserved()
        {
            // Arrange
            var _GoogleResultsPageParser = new GoogleResultsPageParser();
            const string EXPECTED_CAPTURED_LINK_1 = "https://www.infotrack.com.au/products/property-searches/";
            const string EXPECTED_CAPTURED_LINK_2 = "http://testCompany.net/path/";
            var _HtmlContent = "<a href=\"/url?q=https://www.infotrack.com.au/products/property-searches/\"><div class=\"BNeawe vvjwJb AP7Wnd\">Title Search | InfoTrack</div><div class=\"BNeawe UPmit AP7Wnd\">https://www.infotrack.com.au &#8250; products &#8250; property-searches &#8250; title-search</div></a></div><div class=\"NJM3tb\"></div><div class=\"jfp3ef\"><div><div class=\"BNeawe s3v9rd AP7Wnd\"><div><div><a href=\"/url?q=http://testCompany.net/path/\">";

            // Act
            var _SearchEngineResults = _GoogleResultsPageParser.ParseHtmlSearchEngineResults(_HtmlContent);

            // Assert
            Assert.Collection(_SearchEngineResults, 
                r => Assert.True(EXPECTED_CAPTURED_LINK_1 == r.ResultLink && r.Position == 1),
                r => Assert.True(EXPECTED_CAPTURED_LINK_2 == r.ResultLink && r.Position == 2)
            );
        } //ParseHtmlSearchEngineResults_MultipleMatches_PositionsAndCapturesPreserved

        [Fact]
        public void ParseHtmlSearchEngineResults_ContentContainsOtherLinks_OnlyResultsCaptured()
        {
            // Arrange
            var _GoogleResultsPageParser = new GoogleResultsPageParser();
            var _HtmlContent = HTML_CONTENT_WITH_100_RESULTS;

            // Act
            var _SearchEngineResults = _GoogleResultsPageParser.ParseHtmlSearchEngineResults(_HtmlContent).ToList() ;

            // Assert
            Assert.Equal(100, _SearchEngineResults.Count);
        } //ParseHtmlSearchEngineResults_ContentContainsOtherLinks_OnlyResultsCaptured


